export const IuputTodo = (props) => {
    const {todoText, onChange, onClick} = props;
    return(
        <div>
        <input className="input-area" placeholder="TODOを入力" value={todoText} onChange={onChange} />
        <button onClick={onClick}>追加</button>
      </div>

    );
;}
